  `parsed` int(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `parsed_idx` (`parsed`)
) ENGINE=InnoDB DEFAULT CHARACTER SET utf8 DEFAULT COLLATE utf8_general_ci;

ALTER TABLE `appurls` ADD UNIQUE (app_pkg_name(255));

